   contains

   subroutine get_normal(moments,normal)
      implicit none
      real(WP), dimension(:), intent(in) :: moments
      real(WP), dimension(:), intent(out) :: normal
      real(WP), dimension(:), allocatable :: tmparr
      tmparr=max(0.0_WP,matmul(moments,lay1_weight)+lay1_bias)
      tmparr=max(0.0_WP,matmul(tmparr,lay2_weight)+lay2_bias)
      tmparr=max(0.0_WP,matmul(tmparr,lay3_weight)+lay3_bias)
      normal=matmul(tmparr,lay4_weight)+lay4_bias
      deallocate(tmparr)
   end subroutine

   subroutine reflect_moments(moments,center,direction)
      implicit none
      real(WP), dimension(0:188), intent(inout) :: moments
      real(WP), dimension(0:2), intent(in) :: center
      integer, intent(out) :: direction

      direction=0
      if (center(0).lt.0.and.center(1).ge.0.and.center(2).ge.0) then
         direction = 1
         call reflect_moments_x(moments)
      else if (center(0).ge.0.and.center(1).lt.0.and.center(2).ge.0) then
         direction = 2
         call reflect_moments_y(moments)
      else if (center(0).ge.0.and.center(1).ge.0.and.center(2).lt.0) then
         direction = 3
         call reflect_moments_z(moments)
      else if (center(0).lt.0.and.center(1).lt.0.and.center(2).ge.0) then
         direction = 4
         call reflect_moments_x(moments)
         call reflect_moments_y(moments)
      else if (center(0).lt.0.and.center(1).ge.0.and.center(2).lt.0) then
         direction = 5
         call reflect_moments_x(moments)
         call reflect_moments_z(moments)
      else if (center(0).ge.0.and.center(1).lt.0.and.center(2).lt.0) then
         direction = 6
         call reflect_moments_y(moments)
         call reflect_moments_z(moments)
      else if (center(0).lt.0.and.center(1).lt.0.and.center(2).lt.0) then
         direction = 7
         call reflect_moments_x(moments)
         call reflect_moments_y(moments)
         call reflect_moments_z(moments)
      end if
   end subroutine

   subroutine reflect_moments_x(moments)
      implicit none
      real(WP), dimension(0:188), intent(inout) :: moments
      integer :: i,j,k,n
      real(WP) :: temp
      do k=0,2
         do j=0,2
            do i=0,2
               if (i.eq.0) then
               do n=0,6
                  if (n.eq.1.or.n.eq.4) then
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = -moments(7*(2*9+j*3+k)+n)
                     moments(7*(2*9+j*3+k)+n) = -temp
                  else
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = moments(7*(2*9+j*3+k)+n)
                     moments(7*(2*9+j*3+k)+n) = temp
                  end if
               end do
               else if (i.eq.1) then
                  moments(7*(i*9+j*3+k)+1) = -moments(7*(i*9+j*3+k)+1)
                  moments(7*(i*9+j*3+k)+4) = -moments(7*(i*9+j*3+k)+4)
               end if
            end do
         end do
      end do
   end subroutine

   subroutine reflect_moments_y(moments)
      implicit none
      real(WP), dimension(0:188), intent(inout) :: moments
      integer :: i,j,k,n
      real(WP) :: temp
      do k=0,2
         do j=0,2
            do i=0,2
               if (j.eq.0) then
               do n=0,6
                  if (n.eq.2.or.n.eq.5) then
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = -moments(7*(i*9+2*3+k)+n)
                     moments(7*(i*9+2*3+k)+n) = -temp
                  else
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = moments(7*(i*9+2*3+k)+n)
                     moments(7*(i*9+2*3+k)+n) = temp
                  end if
               end do
               else if (j.eq.1) then
                  moments(7*(i*9+j*3+k)+2) = -moments(7*(i*9+j*3+k)+2)
                  moments(7*(i*9+j*3+k)+5) = -moments(7*(i*9+j*3+k)+5)
               end if
            end do
         end do
      end do
   end subroutine

   subroutine reflect_moments_z(moments)
      implicit none
      real(WP), dimension(0:188), intent(inout) :: moments
      integer :: i,j,k,n
      real(WP) :: temp
      do k=0,2
         do j=0,2
            do i=0,2
               if (k.eq.0) then
               do n=0,6
                  if (n.eq.3.or.n.eq.6) then
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = -moments(7*(i*9+j*3+2)+n)
                     moments(7*(i*9+j*3+2)+n) = -temp
                  else
                     temp = moments(7*(i*9+j*3+k)+n)
                     moments(7*(i*9+j*3+k)+n) = moments(7*(i*9+j*3+2)+n)
                     moments(7*(i*9+j*3+2)+n) = temp
                  end if
               end do
               else if (k.eq.1) then
                  moments(7*(i*9+j*3+k)+3) = -moments(7*(i*9+j*3+k)+3)
                  moments(7*(i*9+j*3+k)+6) = -moments(7*(i*9+j*3+k)+6)
               end if
            end do
         end do
      end do
   end subroutine
end module plicnet
